webpackJsonp([0xe2a69361eaee],{704:function(e,t){e.exports={data:{markdownRemark:{html:"<p>Thought I spotted today standing in a crowd<br>\nAbove me knotted was your name expanding in a cloud  </p>\n<p>It seems to me that i cannot curb, any thoughts of you<br>\nThere deemed to disturb each mental blurb, my brain begins to chew  </p>\n<p>My focus cannot linger for more than glint of time<br>\nWithout your smile gleaming in my brain like a half moon's squint, divine  </p>\n<p>And too its brighter than the sun, so compared to both day and night<br>\nNeither is quite like you my hun, you are such a fair delight  </p>\n<p>Indeed, if you where missing I don't think i could go on<br>\nId proceed into dismissing my life into a yawn  </p>\n<p>When your gone just for a night, I feel your ghost against my knee<br>\nUntil the dusting of morning light, when i eat my toast and steep my tea  </p>\n<p>I feel an empty hole inside when you have to go away<br>\nI hope my message was implied thats all i have to say  </p>\n<p>Except that I will love you each moment for all of time<br>\nEvery second, every day, each minute and every hour chime  </p>",frontmatter:{title:"Thought I Spotted You"},fields:{date:null}}},pathContext:{slug:"/songs/thought-i-spotted-you/"}}}});
